hg_nav_node::Msg_2011 msgStruct_2011;

bool Msg_2011_pub_initialized = false;

ros::Publisher Msg_2011_pub;
void init_2011(ros::NodeHandle * n){
	Msg_2011_pub = n->advertise<hg_nav_node::Msg_2011>(MSG_2011_PATH, 5);
	Msg_2011_pub_initialized = true;
	ROS_INFO("Starting pub %s",MSG_2011_PATH);
	return;
}

void stop_2011(void){
	Msg_2011_pub.shutdown();
	Msg_2011_pub_initialized = false;
	ROS_INFO("0x2011 stopped");
	return;
}

