{
	Msg_2011 Message;

	int status = 0;
	status = Message.Deserialize(buffer,getBufSize());

	 if (status != 0) {ROS_WARN("Message 0x2011 deserialization failed! %d returned",status); return;}
	convert(Message, &msgStruct_2011);
	ROS_DEBUG("Message 0x2011 Received");

	// Initialize Publisher if not initialized yet
	if (Msg_2011_pub_initialized == false){
		init_2011(getRosHandle());}
	// Publish the message
	Msg_2011_pub.publish(msgStruct_2011);
	return;
}
